import React from "react";


function Cards (props){
    return(
        <div>
        <div className="card " >
        </div>
         <div className="card-body">
         <h5 class="card-title">{props.name}</h5>
         <p class="card-text">{props.description}</p>
  </div>
  </div>



 

    )
}

export default Cards;
